import html from '../../assets/imagenes/HTML5.png';
import css from '../../assets/imagenes/CSS3.png';
import js from '../../assets/imagenes/JS.png';
import react from '../../assets/imagenes/REACT.png';
import redux from '../../assets/imagenes/REDUX.jpg';
//import java from '../../assets/imagenes/JAVA.png';
import python from '../../assets/imagenes/PYTHON.png';
//import vscode from '../../assets/imagenes/descarga.jpg';


const skills = [
    {
        image: html,
        alternative: 'HTML5',
        id: 1
    },
    {
        image: css,
        alternative: 'CSS3',
        id: 2
    },
    {
        image: js,
        alternative: 'JS',
        id: 3
    },
    {
        image: react,
        alternative: 'React',
        id: 4
    },
    {
        image: redux,
        alternative: 'Redux',
        id: 5
    },
    {
        image: python,
        alternative: 'Python',
        id: 7
    }
]

export default skills;
